var sourceUriGiannis = {
  uri:
    'data:image/jpeg;base64,',
}
var sourceUriLeBron = {
  uri:
    'data:image/jpeg;base64,'
}

var sourceUriLuka = {
  uri:
    'data:image/jpeg;base64,'
}